    value: "<p>With the new year approaching many of you will be applying for <strong>jobs and internships</strong> in the next months. To help you in this journey we are organising a <strong>CV Workshop</strong> at the CLC in Kista. We are looking forward to see you all there, males and females (and everything in between) :D<br />\r\n<br />\r\nInterested? <a href=\"https://goo.gl/forms/XTRo7MBuNFgaK1B12\">Fill out this form</a>&nbsp;to secure a spot and help us organise the event!</p>\r\n"
